INSERT INTO `question` VALUES (1,'Kamu sedang berada di sebuah taman kota yang playgroundnya skateable, dengan floor dan ledge yang crunchy. Ketika kamu meluncur di atas skateboardmu di taman kota tersebut, kamu melintasi sebuah ledge di sebelah kananmu dan kamu Ollie untuk melakukan trick 50-50 Grind di ledge tersebut, lalu kamu landing dan meluncur lagi. Apa nama lain trickmu?','Fakie frontside 50-50','Backside 50-50','Frontside 50-50','Nollie backside 50-50','b','yes','goofy'),(2,'Kamu sedang berada di sebuah taman kota yang playgroundnya skateable, dengan floor dan ledge yang crunchy. Ketika kamu meluncur di atas skateboardmu di taman kota tersebut, kamu melintasi sebuah ledge di sebelah kananmu dan kamu Ollie untuk melakukan trick 50-50 Grind di ledge tersebut, lalu kamu landing dan meluncur lagi. Apa nama lain trickmu?','Fakie frontside 50-50','Backside 50-50','Frontside 50-50','Nollie backside 50-50','c','yes','regular'),(3,'Seorang skateboarder goofy stance sedang berada di taman kota yang playgroundnya skateable, dengan floor dan ledge yang crunchy. Ketika meluncur di atas skateboard di taman kota itu, dia melintasi sebuah ledge di sebelah kanannya dan dia Ollie untuk melakukan trick 50-50 Grind di ledge tersebut, lalu landing dan meluncur lagi. Apa nama lain trick itu?','Fakie frontside 50-50','Backside 50-50','Frontside 50-50','Nollie backside 50-50','b','no','random'),(4,'Seorang skateboarder regular stance sedang berada di taman kota yang playgroundnya skateable, dengan floor dan ledge yang crunchy. Ketika meluncur di atas skateboard di taman kota itu, dia melintasi sebuah ledge di sebelah kanannya dan dia Ollie untuk melakukan trick 50-50 Grind di ledge tersebut, lalu landing dan meluncur lagi. Apa nama lain trick itu?','Fakie frontside 50-50','Backside 50-50','Frontside 50-50','Nollie backside 50-50','c','no','random'),(5,'Skateboarding dunia mengalami kehilangan yang tragis, 12 Oktober 2016, skateboarder pro Dylan Rieder meninggal karena kanker yang 